var Scraper = require ('images-scraper')
  , bing = new Scraper.Bing();


export async function getImages(key) {
  let results = await Bing.list({
    keyword: key,
    num: 15,
  });
  console.log('this is the list of images that we got back: ', results);
  return results;
}
